import React from 'react';
import {NavLink} from "react-router-dom";

const Menu = () =>{
    return(
        <>
            <NavLink activeClassName="active_class" to="/"> AboutUs </NavLink>         
            <NavLink activeClassName="active_class" to="/contact"> ContactUs</NavLink>

        </>
    );
};

export default Menu;
